      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col0 NOT IN ( - + col0, - col2 * + + col1, - col2, - 58 ) OR NOT NULL IS NULL;
  - name: tab1

outputs:
